import React from 'react';
import './Dashboard.css';


export const Textinput = (props) =>{
   return(
       <div className="heading">
          <h1>Type the Text_Input below</h1>
          <input type="text" onChange={props.changedtextinput}/>
          <input type="button" onClick={props.textstored}/>
       </div>
   ); 
}

export const Showtext = (props) =>{
    return(
        <div className="textbox">
         <p>{props.textarray}</p>
        </div>
    );
}
